# Will Create a full screen of "Hackercat"
Function Invoke-Hackercat
{	
	#This starts a sepparate thread to create an http listener for one request which sends hacker cat
	$test = Start-Job -ScriptBlock {
		$url = 'http://127.0.0.1:7070/'
		$htmlcontents = @{
		  'GET /'  =  "<html><style>body {height: 99%; width: 99%; left: 0; top:0; background-color: black; background-image: url(data:image/gif;base64,); background-repeat: no-repeat; background-size: auto 100%; background-position: center;}* {box-sizing: border-box;}p {font-family: monospace;font-weight: bold;font-size: 4.1vh;margin: 0;padding: 0;line-height: 1;color: limegreen;text-shadow: 0px 0px 10px limegreen;}.msg {font-family: monospace;font-weight: bold;text-transform: uppercase;font-size: 5vh;padding-top: 1vh;background: red;box-shadow: 0 0 30px red;text-shadow: 0 0 20px white;color: white;width: 20vw;height: 15vh;position: absolute;left: 50%;margin-left: -10vw;top: 50%;margin-top: -5vh;text-align: center;min-width: 200px;animation-name: blink;animation-duration: 0.6s;animation-iteration-count: infinite;animation-direction: alternate;animation-timing-function: linear;}@keyframes blink {0% {opacity: 0;}100% {opacity: 1;}}</style><body><div class='msg'>Hacked by Hacker Cat</div><div id='console'></div></body><script>var intervalID = window.setInterval(updateScreen, 200);var c = document.getElementById('console');var txt = ['FORCE: XX0022. ENCYPT://000.222.2345','TRYPASS: ********* AUTH CODE: ALPHA GAMMA: 1___ PRIORITY 1','RETRY: REINDEER FLOTILLA','Z:> /FALKEN/GAMES/TICTACTOE/ EXECUTE -PLAYERS 0','================================================','Priority 1 // local / scanning...','scanning ports...','BACKDOOR FOUND (23.45.23.12.00000000)','BACKDOOR FOUND (13.66.23.12.00110000)','BACKDOOR FOUND (13.66.23.12.00110044)','...','...','BRUTE.EXE -r -z','...locating vulnerabilities...','...vulnerabilities found...','MCP/> DEPLOY CLU','SCAN: __ 0100.0000.0554.0080','SCAN: __ 0020.0000.0553.0080','SCAN: __ 0001.0000.0554.0550','SCAN: __ 0012.0000.0553.0030','SCAN: __ 0100.0000.0554.0080','SCAN: __ 0020.0000.0553.0080',];var docfrag = document.createDocumentFragment();function updateScreen() {txt.push(txt.shift());txt.forEach(function(e) {var p = document.createElement('p